import React from 'react'
import { Link } from 'react-router-dom'
import waterLeaf from "./images/waterLeaf.jpeg";

export const NavBar = (props) => {
    return(
        <div>
    <Link to="/">
    Home
    </Link>
    <img alt="water leaf" src={waterLeaf}></img>
    <Link to="/about">
   About
    </Link>
        </div>
    )
}
